import React, { useEffect } from 'react';
import L from 'leaflet';
import 'leaflet/dist/leaflet.css';

const SchoolLocation = () => {
    useEffect(() => {
        // Initialize the map
        const map = L.map('mapContainer').setView([22.708389, 90.359921], 15);

        // HERE Maps App ID and App Code
        const hereAppId = 'YOUR_HERE_APP_ID';
        const hereAppCode = 'YOUR_HERE_APP_CODE';

        // Add HERE Maps tile layer
        L.tileLayer(`https://{s}.base.maps.ls.hereapi.com/maptile/2.1/maptile/newest/normal.day/{z}/{x}/{y}/256/png8?apiKey=${hereAppId}`, {
            attribution: '&copy; <a href="https://legal.here.com/terms">HERE</a> contributors',
            subdomains: '1234',
        }).addTo(map);

        // Optional: Add a marker at the center
        L.marker([22.708389, 90.359921]).addTo(map)
            .bindPopup('School Location')
            .openPopup();
    }, []);

    return <div id="mapContainer" style={{ height: '400px', width: '100%' }} />;
};

export default SchoolLocation;
